import React from "react";
import { Header, Container } from 'semantic-ui-react';

function About() {
  return (
      <Container>
        <Header as ="h2" textAlign="center">ABOUT ME</Header>
        <Container text>
          <hr/>
          My name is Shin. Currently an undergraduate student studying Computer Science and Mathematics.
          My interests are in Software Engineering, Mathematic Teaching, and Design. The current three mottos I follow for my daily life is WORK MORE & PLAY LESS, JUST KEEP WORKING, BOTH QUALITY AND QUANTITY.
        </Container>
      </Container>


  );
}

export default About;
